import Card from '@material-ui/core/Card';
import Typography from '@material-ui/core/Typography';
import Donation from './donation'

export default function Donations() {

    return(
        <Card elevation={0} style={{ textAlign: 'center', minHeight: '500px' }}>
            <Typography variant="h4" component="h2" style={{ borderBottom: "2px solid rgb(212, 212, 212)", marginTop: '30px'}}>
                Recent Donations
            </Typography>
            <Donation />
        </Card>
    )

}
